\u2664\udc18\uef00\u1227\u00bf\u8316\u6e1e\ub8d6\u74bb\uaf36\uec59\ua64d\u0de6\u64a6\u33ee\u110b\u48d6\ue484\u78f0\udb99\ua9fb\u2682\ua825\u08b9\u4a24\u91d6\u11e4\ud5d7\u67d9\u6622\u700f\uea3c\u730c\ue73a\u7bf2\u04ff\u6f6b\ucfba\u1007\u3f2d\u1ca5\ub64b\ubea9\u5c73\udec9\u9263\u656c\u234a\ue4bd\ueae2\uf36f\u50e4\ueb93\u1e87\u934b\uf80e\u320b\u14f9\ub4cf\u5d21\u1d12\ued76\u7fe9\uc0d2\ub45b\u8d20\u1803\ucf22\u9e57\u1cd7\u5893\u5ca5\ua746\u439e\uf513\ue7ab\u621e\u074e\ub33a\u261d\ua617\ua239",
		"\u74fa\u02e2\ue2df\u3aaf\u38a6\u1e30\u4966\u07f3\ud240\u2dc3\u2b66\u3906\u4541\u6f4c\u9225\uf53d\u7c41\u56bf\u1ceb\ub8a6\u9bd7\u1197\u159f\u908d\u4b95\ua8d7\u5d34\ud034\ud339\u7914\u8ca0\u91d4\ue63d\uf922\ufea3\u5a07\ucece\udbe4\ub413\u523d\u100f\u7455\uaff5\ue532\u270c\u2f39\u9011\u6271\u2a8d\u9c49\u2e95\u8d2f\u7197\uca17\ue396\ube15\u2066\u25e3\uaf41\uf02f\u9dd3\u32cd\u25e3\u2517\u895e\uff06\u83d4\ub651\ub34e\u1464\uc1cc\u3de5\u7131\ubdb6\u6be7\ufb86\ue084\u012b\u53a9\ud969\u5504\uef3c\u2ce9\u5b00\u2bf8\u35fe\u5563\ufbaa\u4d92\u95e2\u6259\ub957\u4116\u496f\u80ae\u069c\u4ffa\ue946\u6128\u88b9\u5ee5\u4976\uf7e0\u2335\u8b29\ufe91\u2925\u91dd\ub85b\ua882\u6931\u8b0d\u7d9e\ua43e\u2c6b\u0187\ub6f0\u722f\u254e\u374a\u99f4\u5eb0\u9fb8\u30b7\ue479\u76a1\u07a2\u1b3b\u3384\uc04c\u86d8\u59fd\u1aca\ud2c1\u27cc\ue66c\uf449\u81cd\uf3e0\u4b23\u3980\u9ce1\u3e22\u512d\ua45b\ub4d6\u0872\ue830\u244b\u23a6\ub230\u52c2\u6d1e\u706c\u78ac\u1478\ubb92\u55c7\u8a34\ueb4e\u5022\u3865\u2c00\u3fd7\u5d5c\ue706\uc959\u57be\ue8a4\u5bf1\ud5e5\u3e2b\udc4c\u7269\u83c7\u977a\u1f80\u3615\ud8ff\ufed3\uee08\u0c5d\u0e48\ub054\udf49\u13e7\u2fca\ubd55\ub0af\u70ae\u2e77\u80cb\ued06\ua99c\u7945\u3fd8\ud8f8\u0e89\u0837\u760a\uc4e3\uf4c0\u0bb4\u5db9\ue3bd\uc91c\u7a6d\u6311\u7bea\u33fb\u146d\ua152\uc91e\udcf3\ub8b8\u9fb8\ueb04\uc322\ub2ed\u5897\u4e90\u9d1b\ud554\u7e9f\u0338\udfa0\ub6ba\u42c3\ua1a9\u6e25\uf6b9\ueb05\u219a\ud1fa\ude40\udf0e\u2c49\u95d8\u824d\ufb6c\ue4a2\u3591\udf7b\u866d\ufdb5\u8f8e\u8631\u2e3a\u917b\ub0f7\ufec6\ucbe9\u979e\ud8d0\u50cb\u83c3\uc9b2\ub434\u3f6a\uf528\ue811\uc083\ud8e4\u03ec\ub2d7\uad4b\uaf55\ud0e5\u524d\ua426\uaa9f\u9453\ua206\u51b6\ucd00\u41e8\uc041\u9917\u76ad\ua42d\u137e\uf41d\ude58\u2829\uc5a9\ua74f\u79ed\u22de\u7301\ub401\u7504\u7784\u8b7c\u49d3\ueca9\udd27\u4a0f\u7a15\u5fec\uc581\u4d1a\u56c7\u32d7\ufdb0\u89b9\ud60f\u6538\ua280\u1879\u43f0\udb65\u92cd\udac3\u1451\ua291\u5b89\u3a16\u1a21\u90e1\u49a3\u359f\uf563\uf840\uc53b\u2dba\ucc11\u66bb\u30d4\uddf4\ua54e\u0e01\u53f9\ufaa8\u6479\u3747\ue932\uc5b2\ue3f6\u1918\uc99d\ubc6a\udb35\u9a2c\ue521\ufb28\u0bae\ud40e\u9c57\u7df7\u20ad\uce40\u5f4b\u3b3d\ua91c\uf486\uc85e\u0221\u3c6d\ue057\u100c\u987c\ud41e\u697e\u039b\ud889\u64c3\uc929\ud8fc\u987f\u44c3\u51d2\u25f4\u21af\uc457\u94c1\u11e2\ud5c3\u9d8e\udfb0\u60b2\u5326\u6c18\uf704\u7e8f\udca5\u82c2\u1bea\u2f82\u7e86\u0690\u1c49\ud1f9\u72d6\u6b72\uee99\ub35a\u6963\u7691\u0545\u4193\u3ce7\u3c24\ufd9b\u4636\ud7a7\u9e08\u9e25\u4d1b\ubb68\u69c9\ub51b\u1320\uf76b\ueaad\u318d\ud6d3\u2706\u2b16\u0b10\u12ee\uf480\ud73d\u52ad\u49f2\u8d55\u907a\ua70c\u1137\uf433\u2290\u892b\u33d6\ud5d8\udb36\u6c13\u78c9\u8654\u4099\u3fcd\ue17f\ub2ab\u6b88\ubb03\u54a4\ua9b4\uc816\u999f\u198f\u4574\uef8e\uc2ea\uaea0\u5ef8\u275b\uf1b9\udca2\ua58a\u15ae\u4482\ua1c0\u2af9\u351e\u6ed3\u02f0\u9490\u7457\u8bbb\ue983\u9235\u21fb\u4dc7\ubacc\u91e1\u7c5b\uae4d\udf4c\u39b2\ude5e\u61ce\uc600\ua846\uff89\ue703\uc974\u8341\u4c8f\ub530\u8c26\ubf7e\ufa0e\u55fd\ua8d1\u89d2\u7dca\u8b13\u0dd6\ud036\u45a6\u9655\ud051\u36bd\ucccc\u6b98\u5d63\u38c5\ucd7c\ue682\ubcb0\uddbc\u55d9\u7e0e\ud73c\u8c92\u398f\u27f0\u4a3a\u3c08\uc152\ud140\u28f8\uabb7\ubef6\uc7bc\u733d\u9b74\u6504\uc7c6\u2e87\u06da\u6f64\u3fe1\u122a\u5dd7\ua708\u637e\u68e9\u208f\u051a\u4257\u49e6\u900f\u8a38\u3e87\uc2b9\u8f2d\u3046\u4f8e\u9146\uf757\u7e10\u9d7c\u01d6\u8019\u2078\ude7c\uee69\u1783\u14bb\u232e\u2caf\u465c\u9ae2\ufbdf\ufdde\u7c0f\u4e56\ueafd\u196c\u81a3\u12c5\u61bd\u172d\u546c\u0c8e\ude2a\u394a\u6582\u8cfe\u89eb\ub22c\u2114\uc425\u43bb\uc903\u6337\u27f1\u6b7f\u3868\u728b\u02f9\uf6ee\u1f13\u26a4\u4e1c\uf4ae\u547a\u0aa3\u58f2\u198b\u1cea\u7075\u5dd6\u6479\u5cea\u1798\u3419\u2eaa\ub13f\uec7e\u658b\u2817\u5091\u3365\uaf9c\u84f2\u30a5\uff75\uf8fd\u915c\u2c5f\u6dc0\ua3cf\ub0c4\uffd9\u9554\u04de\u30e3\u864c\u68a0\ucf38\u80bc\ud687\u0423\u9426\uf963\ubee3\uca9c\u4fca\u9510\ueb2a\ud21d\u9fb2\u587d\u5600\ua50d\u2d53\ubff8\uc48c\u6a3d\ue60e\ue408\u1000\uc5cc\uce78\u157f\ud54b\ubcb5\uc35f\u0dab\ufb83\u3487\uda4c\u67d4\ue774\u1463\u71ca\u9cec\u0c2e\ua36e\u7538\u0215\u2451\uce8f\u803e\uf72f\ud5c6\u38e3\ua191\u2c3a\u8fa6\u5245\u7703\u6b53\udaaf\u52d7\u943a\u6032\u7563\uf024\u570f\u3dd0\u92a1\u2ce7\u67ae\u0f9c\ud565\u34ca\ud242\ua9f5\ue411\ua165\u219b\uab83\u0db9[\ua5f7\u7fb6\ufab8\ud8bd\u3934\ua03d\u2323\u2868\u3587\u07ce\u8b16\u5a04\u96d4\u4a33\u050d\ubeb0\ua150\u36e5\udfc2\uaff8\u0dfd\ub602\u2d47\ue917\ucf6b\u2e63\u29b8\u541a\u3370\u602e\u3051\uc95c\u0287\uc6da\u1416\uab92\uef71\ud6d8\u28c5\u6d4b\u3664\ueb67\uf091\ua6b0\u9942\u64b1\ud63e\u522a\u3ff3\ud87f\u3987\u7ca1\uf020\u42f4\u10b0\u118d\ub402\u72d7\u54d9\udd81\ua045\u07f3\u1d55\uf947\u1431\uf74a\u0f9a\u01bf\ud5ce\uce74\u21e1\uf299\u441c\uc719\u8745\u38c5\u0fdf\u9bd4\u618b\u8143\ub54f\u4b47\uf191\ub8d3\u2d06\ub7e1\u0d14\uaff9\ued9e\u965f\u59b2\ue3d6\u2074\ub00d\u2e7e\u0586\u469d\u1068\u2e40\u2913\ufaa9\ue7d3\u0c81\ud266\uc5cd\u34a7\uebf1\u283d\uf112\ueb06\ud034\u9404\ua592\u73de\ub227\u0d15\uf95c\u5728\u10dc\u5bee\u2e6d\uf258\uc7c2\uddb2\u0fb1\u0cbe\u9b2f\ufb8f\uaf01\u27b1\uc26e\u0f32\u1b26\u7a63\u25fe\u502a\u7d70\u6b91\u7abe\u76a6\ud296\u525d\ua49c\ufdea\u1dc0\u31e8\ube91\ub020\u63b9\u1d0c\ue644\u2af0\ue630\u1813\uf4f8\u21cd\u4d0e\u200c\ueea3\ua95b\ucb81\u9ca0\u61e9\u2a90\u366b\u2aed\u74c0\u29e1\u3655\uc449\ub2a6\u189d\u388f\u0706\u2aff\u2096\uae92\u76b9\ucf48\uda1c\u1ecb\u0770\u90da\u856d\ue767\uddff\u342e\u7797\udafe\uf7ff\u2b83\u8a80\u55b1\u1613\u75e1\u876f\u889e\ua1cf\u90db\u6ff4\u024b\u2188\ua93e\u41b4\u8d48\ue71d\u1fbf\ufd10\ub63f\uf76f\ubaaf\uc281\uac29\uc2ee\u9b27\ub691\u1874\u6a17\u6a19\u3a10\uf808\u3b37\u9b15\u1f62\ud91a\ub3b1\u4f0e\uf0ef\u1bd8\u6264\ue3c3\u4262\u9002\ud6a9\u7222\u074c\u3c5c\uf043\u385e\ua835\u64b1\u61e7\ubd8c\uf157\u5a4b\u5489\ucdfc\u4a0d\u737f\udf84\uc3f2\ua915\u0147\uc0fb\u7a61\ubafc\ua2ec\u3aaf\ue79d\ua141\ue843\u1a75\u6137\uf8bd\ub31a\u92f7\uaff9\u8611\ua92d\u4014\ua8f6\ud6a5\udd96\u8a82\uae52\u492c\u3959\u0656\u4fa7\ufb30\u23c8\udce2\ub1c8\u71bb\u97dd\u8159\u8415\uc647\u3799\ucfc9\u04c0\u1636\u232c\u4bff\uafe5\u468c\ucf9b\u8c2b\u90bc\u8a3d\u6382\u6fa6\u9fcf\uc7c7\u099c\u00fd\ufbee\u8f41\u8274\u582e\ue2b4\u2e3c\ube60\u57dc\u5ea4\u48a2\ua93e\uc816\u6183\u4127\u97f7\ucef0\u502f\u577d\ucafb\u8314\u5ea8\u8e93\uaa77\u611f\u8eec\u92fb\u59c9\u96ae\u20de\uc221\ub4d6\u601a\u7f6f\u6cc9\u21d1\u385c\u49fb\u0706\u0b0c\ue414\u45c0\u9765\u1ba2\ua6dd\u6422\uf106\u4be1\u063e\ue5cb\ub55e\u9223\uc492\ucf86\u374a\ucc90\u3fa3\u963c\u7ffe\u9e13\udf17\u0f90\u3ebe\u7034\ue7e4\u261c\uc8b3\u25f2\ud389\u5352\u4903\u398b\u4217\u6f0e\u0ff2\uf7dd\ucbdf\u14e6\u8fb6\uc59f\u3abf\u285c\ue835\u8920\u1be1\u444b\ucb0c\u36e3\u02c0\ud7a8\u1aaa\u6233\ubf96\u9f64\u0192\ud49e\ud762\u0693\u2f55\u689c\uee83\ued23\u3893\ue254\ueffd\ua77f\uc234\u02b3\u58f2\ua21c\u278d\u5b44\ub0fe\u0ef7\ud174\u45ae\u5482\u4db7\u00c2\ua702\uc000\u43e6\u468b\u6e4c\u53a6\u5a62\uf5c1\u9893\u0939\u7056\u0789\u9619\ud694\u12bd\uf52d\u3089\uc18b\uc986\u11fe\ub665\ubee3\u581a\u2973\uc19c\u60c2\u4276\u6ccb\u3892\u3973\u71e3\u14aa\u0c35\ue950\uafd2\u4025\uf5f1\u9d14\u8ff2\u492b\u9586\u0a7a\u084c\ubfb0\u3a1e\ubbee\uf1bb\u8abd\u67df\u0170\u5312\u1663\ua664\u4857\u6e50\u5667\ub001\u33e1\ub4b3\u92a0\uff9d\uff86\u9066\ucd66\u33b3\u3134\ue47f\u34f2\u3155\u10f2\u19fd\u3905\u6cac\uf3fa\uee6b\ufb77\ud071\u7562\ue549\uaba5\u2c11\u77e8\ua558\u81a9\u850a\u09d1\u3cb8\u0e04\ub42c\u3eaa\u8725\u5904\u6e84\u3b34\u6911\ue506\u7eca\uad68\uea50\ua655\u3f12\u9bb7\u62d2\u5c4e\u50e5\u4757\u52d1\u6d2f\u8fac\u00c2\u287c\u485a\ue377\u81ce\u15f8\u6348\ue875\udcda\u2e03\u9763\udf69\u7148\ucd7f\ue03d\ucc7d\ua32c\u0c8e\ud1cf\uf5a8\u5629\u8d1f\ucf55\u9b0c\u6563\uf01d\u684d\u69db\ua271\ub153\u1022\u5afd\uc35e\u6a79\u0163\u3f09\u52ab\u1912\u87b6\uf25e\u9c4f\u111b\ua037\ub531\u860f\ua1f3\u13d4\uef96\uba0c\uc94a\uae5f\ubecb\ub112\ufe8b\u2cc9\u2d04\u012c\ue89a\u258b\u10b5\u8bd4\u3de8\u3061\ud75f\u6faa\u428d\u38f9\u9e61\u95df\ufc65\uc29a\u1cdc\u0203\u7e45\u6514\u804a\u4917\ue090\u3ca9\uec77\u172a\u2fe9\u5fec\u0f71\u9ca1\u13a2\u239d\u4e6c\u1fde\uaacb\u202e\u571a\u3cbb\u9f69\ubb52\u0ba2\ua971\u8b64\u6219\u3a20\ub84e\u4209\u171b\ub12d\ue4e5\u46e7\u2854\uf3bc\ucaa2\ub50f\u2d08\udc76\u53f5\u6227\ue06a\u8610\uf370\u02aa\u14b3\u6909\ucf20\u10ea\ue7b5\u23a6\uf658\u4ded\u4fa3\ub1a5\uf1cc\u73da\uf646\u0cd5\u03ec\u75be\ub508\u8534\ub35d\u6cca\u5695\u0fa6\udb85\uc2d4\u44c8\u7eb6\uba80\u2e8a\u1f28\u5aa4\u4d5e\u15ae\u5861\u67c6\u126f\u58cf\ucf82\ua49a\uc811\u59a5\ua546\u5349\u6a7f\u459c\uaade\u9616\u50dc\ubcc5\u608d\u9ae4\ud5e9\u2f13\u66df\ua5ca\u21d0\u8c0b\ubea9\u0fc7\u5868\ub4d3\u0b2d\u6927\u48d9\uab3d\u00e1\ue94f\ufd60\u8c1f\uea6b\ue9c5\u1f68\uc003\udffe\u0c31\u6d24\ubab4\u7a0d\u18c5\u7fc5\u7fda\u0ce9\ua356\u061b\u9bdb\u9862\uac89\ufa82\ub533\ud759\u3430\uca90\u805f\ud305\u886e\u5ccf\ub303\uc737\u86dd\u3d50\u2bfc\u76b9\u7825\u1ccc\u7805\u74a7\uc24d\u90ee\u64fd\ue529\u9c47\u64db\u255d\u47bd\u1b91\u4122\ub85f\u1fd4\uef40\ue447\uc6cf\ue85e\u342f\ufad0\uecde\u62f7\ufd19\ud1c7\ue6d7\u260d\ua2b5\uc397\u1f61\ude6e\u624d\u5166\u9b15\u371e\u222a\u746c\ubb4f\u7883\ucb84\ua279\u616b\u50aa\ud6ed\u53ba\u7eff\uab56\ua2fb\uff2a\ueb08\ucfe3\u6bcf\u286d\udc8b\ude03\u301c\u262a\u3e9b\u0192\uf8fc\ub48e\u4dce\u83b1\uce94\ufb4c\u806f\u039e\u5cc3\ufb27\uf1b4\ub39d\ubff4\uff40\u7d31\ud3dc\ufe93\u3b8a\u297f\u5778\u709a\ud326\ue826\uebca\u8b92\ude26\u53e8\u1cb2\u7b04\uf020\u9147\u1a68\u9dfc\u5851\u7595\u0174\u86f5\ud677\u5078\u45f5\u8cc7\uf046\ucc10\u17de\u0e71\ub062\ud499\ub462\ua4c9\u1e27\ud1ce\uf8ed\u7333\ud297\u5195\ub673\u096e\u9868\u3479\u0941\ufc67\ua424\u6570\u4e69\u7fc1\ud3b3\ua875\ua7c8\u08db\u513c\u1144\uf633\ue57b\u17ab\u4f70\u5c62\uedaf\ud7a5\uc603\u10b1\uce95\u3a94\ub501\ub845\u47f9\u052d\uebad\ub3a9\u769c\uaa2c\u9d8e\uac0a\u6ca5\u22ee\u0141\ub194\u02ce\u92e4\u575a\u8c2f\u7c2f\u5da0\ubd48\u2fd9\u9ade\u4bda\u4002\u3c77\u2cb7\u8de9\u5838\u7f11\u1f38\u4116\u834c\ue61c\u5006\u8920\u7d8e\u8f75\u5ca2\ud3e3\ub648\u8c7a\u07fc\u50fd\u0c84\uae79\u1563\u4b8f\u4400\u4403\u3940\u5dec\ud411\ue07d\uae06\u5a75\u23ac\u925a\u010d\u2162\u9539\u38c2\ubae2\u0a27\ue0f7\uc548\uf6ac\u247a